contracts/learntgehterArticles.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import {LinkTokenInterface} from "../node_modules/@chainlink/contracts/src/v0.8/interfaces/LinkTokenInterface.sol";

interface ChainlinkAutomation{
    function addFunds(uint256 upkeepId, uint256 amount) external;
}

interface OrchestrationContractInterface{
    function getSubjectInfo(string memory _subjectName) external returns (uint256, uint256, uint256);
    function getReviewerCreds(address reviewerAddress, string memory subjectName) external returns(uint256); 
}

contract learntgetherArticles is ERC721Enumerable, Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIdCounter;

    struct Article {
        string ipfsHash;
        string title;
        address authorAddress;
        string authorName;
        string description;
        string subject;
        uint256 consensous; 
        uint256 timestamp;
    }

    struct Review{
        address reviewer;
        string ipfsHash;
        uint256 consensous; 
        uint256 creds;
    }

    mapping(uint256 => string) consenousType;
    mapping(uint256 => Review[]) public articleReviews;


    mapping(uint256 => Article) public articles;
    mapping(string => uint256) public ipfsHashToTokenId;


    LinkTokenInterface private linkToken;
    ChainlinkAutomation public AutomationContract; 
    address AutomationContractAddress; 

    OrchestrationContractInterface public OrchestrationContract; 

    uint256 public proposalFeeInLink;
    uint256 public openVoteTime;
    uint256 public proposalQueueCounter;
    uint256 public upkeepId;

    constructor(address _orchestrationContract, address _automationContract, address _linkTokenAddress ) ERC721("LearntgetherArticles", "LTA") {
        consenousType[0]= "Review Pending";   
        consenousType[1]= "Accepted";
        consenousType[2]= "Rejected";
        consenousType[3]= "Revise and Resubmit";
        AutomationContract= ChainlinkAutomation(_automationContract);
        AutomationContractAddress= _automationContract;

        OrchestrationContract= OrchestrationContractInterface(_orchestrationContract);
        linkToken = LinkTokenInterface(_linkTokenAddress);


    }




    // Events
    event ArticleMinted(uint256 indexed articleId, address indexed author, string title, string subject, string ipfsHash, string description);
    event ReviewSubmitted(uint256 indexed articleId, address indexed reviewer, uint256 consensus, uint256 creds, string ipfsHash);
    event ConsensusUpdated(uint256 indexed articleId, uint256 newConsensus);

    function mintArticle(
        string memory _ipfsHash,
        string memory _title,
        string memory _authorName,
        string memory _description,
        string memory _subject
    ) public returns (uint256) {

        require(ipfsHashToTokenId[_ipfsHash] == 0, "IPFS hash already used");


        (uint256 numReviewsForAcceptance, uint256 credsNeededForReview, uint256 percentAcceptsNeeded) = OrchestrationContract.getSubjectInfo(_subject);

        uint256 newTokenId = _tokenIdCounter.current();
        _safeMint(msg.sender, newTokenId);
        _tokenIdCounter.increment();

        Article memory newArticle = Article({
            ipfsHash: _ipfsHash,
            title: _title,
            authorAddress: msg.sender,
            authorName: _authorName,
            description: _description,
            subject: _subject,
            consensous: 0,
            timestamp: block.timestamp
        });

        require(linkToken.transferFrom( msg.sender, address(this), proposalFeeInLink), "Fee transfer failed");
        linkToken.approve(AutomationContractAddress, proposalFeeInLink);
        AutomationContract.addFunds(upkeepId, proposalFeeInLink);


        articles[newTokenId] = newArticle;
        ipfsHashToTokenId[_ipfsHash] = newTokenId;

        emit ArticleMinted(newTokenId, msg.sender, _title, _subject, _ipfsHash, _description);
        return newTokenId;
    }




    function submitReview(uint256 _articleId, string memory _ipfsHash, uint256 _consensous) public {
        // Check if the article exists
        require(_exists(_articleId), "Article does not exist");

        // Check if the reviewer has the necessary credentials
        uint256 creds = OrchestrationContract.getReviewerCreds(msg.sender, articles[_articleId].subject);


        // Create a new review
        Review memory newReview = Review({
            reviewer: msg.sender,
            ipfsHash: _ipfsHash,
            consensous: _consensous,
            creds: creds
        });

        // Add the review to the article's reviews
        emit ReviewSubmitted(_articleId, msg.sender, _consensous, creds, _ipfsHash);
        articleReviews[_articleId].push(newReview);
    }


    function checkUpKeep(bytes calldata /* check data*/)  external view  returns( bool upkeepNeeded, bytes memory /* performData*/  ){
        upkeepNeeded = (block.timestamp > articles[proposalQueueCounter].timestamp + openVoteTime);
    }




    function performUpkeep(bytes calldata /* performData */) external {
        // revalidation
        if (block.timestamp > articles[proposalQueueCounter].timestamp + openVoteTime) {

            (uint256 numReviewsForAcceptance, uint256 credsNeededForReview, uint256 percentAcceptsNeeded) = OrchestrationContract.getSubjectInfo(articles[proposalQueueCounter].subject);

            Review[] memory reviews = articleReviews[proposalQueueCounter];

            // Check if there are enough reviews
            if (reviews.length < numReviewsForAcceptance) {
                articles[proposalQueueCounter].consensous = 2; // Rejected due to insufficient reviews
            } else {
                uint256 totalCredsAccepted = 0;
                uint256 totalCredsNotAccepted = 0;
                uint256 acceptedReviewsCount = 0;

                for (uint256 i = 0; i < reviews.length; i++) {
                    // Only consider reviews from reviewers with enough credentials
                    if (reviews[i].creds >= credsNeededForReview) {
                        if (reviews[i].consensous == 1) { // Assuming 1 is the code for "Accepted"
                            totalCredsAccepted += reviews[i].creds;
                            acceptedReviewsCount++;
                        } else {
                            totalCredsNotAccepted += reviews[i].creds;
                        }
                    }
                }

                uint256 percentAcceptedByCount = (acceptedReviewsCount * 100) / reviews.length;

                if (totalCredsAccepted > totalCredsNotAccepted && percentAcceptedByCount >= percentAcceptsNeeded) {
                    articles[proposalQueueCounter].consensous = 1; // Accepted
                } else {
                    articles[proposalQueueCounter].consensous = 2; // Rejected
                }

            }
            emit ConsensusUpdated(proposalQueueCounter, articles[proposalQueueCounter].consensous);

            proposalQueueCounter++;
        }
    }




    function getArticleByHash(string memory _ipfsHash) external returns (string memory ipfsHash, string memory title, address authorAddress, string memory authorName, string  memory description, string memory subject, uint256 consensous, uint256 timestamp){
        require(ipfsHashToTokenId[_ipfsHash] != 0, "IPFS hash not attached to Article");

        Article storage article = articles[ipfsHashToTokenId[_ipfsHash]];
        return(article.ipfsHash, article.title, article.authorAddress, article.authorName, article.description, article.subject,article.consensous,article.timestamp);

    }



    function getReviewsForArticle(uint256 _articleId) public view returns (Review[] memory) {
        return articleReviews[_articleId];
    }


    function getArticle(uint256 tokenId) public view returns (Article memory) {
        require(_exists(tokenId), "Article does not exist");
        return articles[tokenId];
    }



    // Only Owner Funcitons
    function setAutomationRegistry(address _contractAddress) external onlyOwner {
        AutomationContract= ChainlinkAutomation(_contractAddress);
        AutomationContractAddress= _contractAddress;

    }

    function setFee(uint256 _feePrice) external onlyOwner {
        proposalFeeInLink= _feePrice;

    }


    function setOpenVoteTime(uint256 _votetime) external onlyOwner {
        openVoteTime= _votetime;

    }

    function setUpkkepId(uint256 _upkeepId) external onlyOwner {
        upkeepId= _upkeepId;

    }


    function sendArticleToContract(uint256 tokenId, address contractAddress) external {
        // Ensure the caller is the owner of the token or an approved operator
        require(ownerOf(tokenId) == msg.sender || isApprovedForAll(ownerOf(tokenId), msg.sender), "Not authorized");

        // Use safeTransferFrom to ensure the receiving contract can handle ERC721 tokens
        safeTransferFrom(msg.sender, contractAddress, tokenId);
    }



}

contracts/learntgetherOrchestration.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import {LinkTokenInterface} from "../node_modules/@chainlink/contracts/src/v0.8/interfaces/LinkTokenInterface.sol";

interface ChainlinkAutomation{
    function addFunds(uint256 upkeepId, uint256 amount) external;
}

contract learntgetherOrchestration{


    struct Reviewer {
        string name;
        string description;
        string[] degrees; 
        string[] awards;
        mapping(string => subjectInfo) subjectInfo;
    }

    struct subjectInfo{
        uint256 creds;
        mapping(address => bool) hasGivenCred;
        bool isReviewer;
    } 

    mapping(address => Reviewer) reviewersMap; // Use a mapping for easy access to reviewers by address

    struct Subject  {
        address creator;
        uint256 numReviewsForAcceptance;
        uint256 credsNeededForReview;
        uint256 percentAcceptsNeeded;
        uint256 minCredsToProposeVote;        // Minimum creds needed to propose a vote
        uint256 minCredsToVote;               // Minimum creds required to vote
        uint256 maxCredsCountedForVote;       // Maximum creds that can be counted for a vote
        uint256 minProposalVotes;
    }
    mapping(string => Subject) public subjects;

    string[] public subjectNames;


    struct Proposal {
        address proposer;
        string subjectName;
        uint256 numReviewsForAcceptance;
        uint256 credsNeededForReview;
        uint256 percentAcceptsNeeded;
        uint256 minCredsToProposeVote;
        uint256 minCredsToVote;
        uint256 maxCredsCountedForVote;
        uint256 minProposalVotes;
        uint256 timestamp;
        uint256 approveVotes;
        uint256 denyVotes;
        uint256 approveCreds;
        uint256 denyCreds;
        mapping(address => bool) votes; // to track which reviewers have voted true for approve false for deny
        bool isActive;
        bool passed;

    }

    mapping(uint256=> Proposal) public proposals;
    uint256 public proposalCounter;



    LinkTokenInterface private linkToken;
    address private owner;
    uint256 public proposalFeeInLink;
    uint256 public openVoteTime;
    uint256 public proposalQueueCounter;

    ChainlinkAutomation public AutomationContract; 
    address AutomationContractAddress; 

    // Mumbai 0x57A4a13b35d25EE78e084168aBaC5ad360252467

    uint256 public upkeepId;

    bool devMode;
    constructor(address _linkTokenAddress, address _automationAddress, uint256 _feePrice, bool _devMode) {
        owner = msg.sender;

        linkToken = LinkTokenInterface(_linkTokenAddress);
        AutomationContract= ChainlinkAutomation(_automationAddress);

        proposalFeeInLink = _feePrice;
        AutomationContractAddress= _automationAddress;

        proposalCounter = 1;
        proposalQueueCounter = 1;


        devMode = _devMode;
    }


    // Modifiers
    modifier onlyOwner() {
        require(msg.sender == owner, "Not the contract owner");
        _;
    }

    modifier isDevMode() {
        require(devMode == true, "Contract Not In Dev Mode");
        _;
    }

    modifier credRules(string memory _subjectName, address _reviewer){

        // Ensure the subject exsits 
        require(subjects[_subjectName].creator != address(0), "Subject doesn't exist.");

        // Ensure the sender is a reviewer for the subject
        require(reviewersMap[msg.sender].subjectInfo[_subjectName].isReviewer == true, "You are not a reviewer for this subject.");

        // Ensure the target reviewer exists for this subject
        require(reviewersMap[_reviewer].subjectInfo[_subjectName].isReviewer == true, "Target reviewer doesn't exist for this subject.");

        // Ensure a reviewer is not editing creds to themselves
        require(msg.sender != _reviewer, "You cannot edit your own creds.");
        _;

    }

    // Events 


    event SubjectCreated(
        string indexed subjectName, 
        address creator,
        uint256 numReviewsForAcceptance,
        uint256 credsNeededForReview,
        uint256 percentAcceptsNeeded,
        uint256 minCredsToProposeVote,
        uint256 minCredsToVote,
        uint256 maxCredsCountedForVote,
        uint256 minProposalVotes);

    event ProposalCreated(
        address proposer,
        string subjectName,
        uint256 numReviewsForAcceptance,
        uint256 credsNeededForReview,
        uint256 percentAcceptsNeeded,
        uint256 minCredsToProposeVote,
        uint256 minCredsToVote,
        uint256 maxCredsCountedForVote,
        uint256 minProposalVotes,
        uint256 timestamp,
        bool isActive

    );

    event ReviewerAdded(string indexed subjectName, address indexed reviewerAddress);
    event ReviewerRemoved(string indexed subjectName, address indexed reviewerAddress);

    event CredsAdded(string indexed subjectName, address indexed reviewer, uint256 creds );
    event CredsRemoved(string indexed subjectName, address indexed reviewer, uint256 creds);
    event Voted(uint256 indexed proposalId, address indexed voter, bool voteChoice);
    event ReviewerInfo(address reviewerAddress ,string name, string description, string[] degrees, string[] awards );
    event ProposalResult(uint256 proposalId, bool passed);
    event SubjectUpdated(
        string indexed subjectName, 
        uint256 proposalId,
        address creator,
        uint256 numReviewsForAcceptance,
        uint256 credsNeededForReview,
        uint256 percentAcceptsNeeded,
        uint256 minCredsToProposeVote,
        uint256 minCredsToVote,
        uint256 maxCredsCountedForVote,
        uint256 minProposalVotes);


    /*
        * @notice Creates a new subject in the system.
        * @dev Ensures the subject does not already exist.
        * @param _subjectName Name of the subject to be created.
        * @param _numReviewsForAcceptance Number of reviews required for acceptance.
        * @param _credsNeededForReview Creds required for a review.
        * @param _percentAcceptsNeeded Percentage of accepts needed.
        * @param _minCredsToProposeVote Minimum creds required to propose a vote.
        * @param _minCredsToVote Minimum creds required to vote.
        * @param _maxCredsCountedForVote Maximum creds that can be counted for a vote.
        * @param _minProposalVotes Minimum proposal votes required.
    */
    function createSubject(
        string memory _subjectName,
        uint256 _numReviewsForAcceptance,
        uint256 _credsNeededForReview,
        uint256 _percentAcceptsNeeded,
        uint256 _minCredsToProposeVote,
        uint256 _minCredsToVote,
        uint256 _maxCredsCountedForVote,
        uint256 _minProposalVotes
    ) public  {

        // Ensure Subject Does not exsist

        require(subjects[_subjectName].creator == address(0), "Subject already exists.");

        // Add subject parameters

        subjects[_subjectName].creator = msg.sender;
        subjects[_subjectName].numReviewsForAcceptance = _numReviewsForAcceptance;
        subjects[_subjectName].credsNeededForReview = _credsNeededForReview;
        subjects[_subjectName].percentAcceptsNeeded = _percentAcceptsNeeded;
        subjects[_subjectName].minCredsToProposeVote = _minCredsToProposeVote;
        subjects[_subjectName].minCredsToVote = _minCredsToVote;
        subjects[_subjectName].maxCredsCountedForVote = _maxCredsCountedForVote;
        subjects[_subjectName].minProposalVotes = _minProposalVotes;


        subjectNames.push(_subjectName);

        emit SubjectCreated(_subjectName, msg.sender, _numReviewsForAcceptance, _credsNeededForReview, _percentAcceptsNeeded,_minCredsToProposeVote, _minCredsToVote, _maxCredsCountedForVote, _minProposalVotes);
    }


        /*
            * @notice Adds the sender as a reviewer for a given subject.
            * @dev Ensures the subject exists and the sender is not already a reviewer.
            * @param _subjectName Name of the subject.
        */

    function addSelfAsReviewer(string memory _subjectName) public  {

        require(subjects[_subjectName].creator != address(0), "Subject doesn't exist.");
        require(reviewersMap[msg.sender].subjectInfo[_subjectName].isReviewer != true, "You are already a reviewer for this subject.");


        reviewersMap[msg.sender].subjectInfo[_subjectName].isReviewer= true;
        emit ReviewerAdded(_subjectName, msg.sender);
    }

        /*

            * @notice Removes the sender as a reviewer for a given subject.
            * @dev Ensures the subject exists and the sender is currently a reviewer.
            * @param _subjectName Name of the subject.

        */
    function removeSelfAsReviewer(string memory _subjectName) public  {

        require(subjects[_subjectName].creator != address(0), "Subject doesn't exist.");
        require(reviewersMap[msg.sender].subjectInfo[_subjectName].isReviewer != false, "You are not a reviewer for this subject.");


        reviewersMap[msg.sender].subjectInfo[_subjectName].isReviewer= false;
        emit ReviewerRemoved(_subjectName, msg.sender);
    }

    /*

       * @notice Updates the information of a reviewer.
       * @param _name Name of the reviewer.
       * @param _description Description about the reviewer.
       * @param _degrees List of degrees the reviewer holds.
       * @param _awards List of awards the reviewer has received.


    */

    function updateReviewerInfo(string memory _name, string memory _description, string[] memory _degrees, string[] memory _awards ) public {
        reviewersMap[msg.sender].name = _name;
        reviewersMap[msg.sender].description = _description;
        reviewersMap[msg.sender].degrees = _degrees;
        reviewersMap[msg.sender].awards = _awards;
        emit ReviewerInfo(msg.sender, _name, _description, _degrees, _awards);

    }

    /*
        * @notice Adds creds to a reviewer for a given subject.
        * @dev Ensures the subject exists and the sender has the authority to add creds.
        * @param _subjectName Name of the subject.
        * @param _reviewer Address of the reviewer.
    */
    function addCredsToReviewer(string memory _subjectName, address _reviewer) external  credRules(_subjectName, _reviewer) {
        require(!reviewersMap[_reviewer].subjectInfo[_subjectName].hasGivenCred[msg.sender], "You've already given a cred to this reviewer.");

        reviewersMap[_reviewer].subjectInfo[_subjectName].creds += 1;
        reviewersMap[_reviewer].subjectInfo[_subjectName].hasGivenCred[msg.sender] = true;

        emit CredsAdded(_subjectName, _reviewer, reviewersMap[_reviewer].subjectInfo[_subjectName].creds);
    }


    /*
        * @notice Removes creds from a reviewer for a given subject.
        * @dev Ensures the subject exists and the sender has the authority to remove creds.
        * @param _subjectName Name of the subject.
        * @param _reviewer Address of the reviewer.
    */
    function removeCredsFromReviewer(string memory _subjectName, address _reviewer) external credRules(_subjectName, _reviewer){
        require(reviewersMap[_reviewer].subjectInfo[_subjectName].hasGivenCred[msg.sender], "You have not given a cred to this reviewer yet.");

        reviewersMap[_reviewer].subjectInfo[_subjectName].creds -= 1;
        reviewersMap[_reviewer].subjectInfo[_subjectName].hasGivenCred[msg.sender] = false;
        emit CredsRemoved(_subjectName, _reviewer, reviewersMap[_reviewer].subjectInfo[_subjectName].creds);
    }



    /*
    * @notice Proposes changes to a subject's parameters.
    * @dev Ensures the subject exists and the proposer meets the requirements. Must Approve LinkFee to Contract before calling.
    * @param _subjectName Name of the subject to be updated.
    * @param _numReviewsForAcceptance Number of reviews required for acceptance.
    * @param _credsNeededForReview Creds required for a review.
    * @param _percentAcceptsNeeded Percentage of accepts needed.
    * @param _minCredsToProposeVote Minimum creds required to propose a vote.
    * @param _minCredsToVote Minimum creds required to vote.
    * @param _maxCredsCountedForVote Maximum creds that can be counted for a vote.
    * @param _minProposalVotes Minimum proposal votes required.

    */
    function propose(
        string memory _subjectName,
        uint256 _numReviewsForAcceptance,
        uint256 _credsNeededForReview,
        uint256 _percentAcceptsNeeded,
        uint256 _minCredsToProposeVote,
        uint256 _minCredsToVote,
        uint256 _maxCredsCountedForVote,
        uint256 _minProposalVotes
    ) external {
        // Ensure the subject exists
        require(subjects[_subjectName].creator != address(0), "Subject doesn't exist");

        // Ensure the proposer is a reviewer for the subject and has enough creds
        require( reviewersMap[msg.sender].subjectInfo[_subjectName].isReviewer == true, "You are not a reviewer for this subject.");
        require( reviewersMap[msg.sender].subjectInfo[_subjectName].creds >= subjects[_subjectName].minCredsToProposeVote, "Insufficient creds to propose.");
        // Ensure the proposer has paid the required LINK fee
        require(linkToken.transferFrom( msg.sender, address(this), proposalFeeInLink), "Fee transfer failed");

        // Create a new proposal using the proposalCounter as an ID
        Proposal storage newProposal = proposals[proposalCounter];

        // Set the properties of the new proposal
        newProposal.proposer = msg.sender;
        newProposal.subjectName = _subjectName;
        newProposal.numReviewsForAcceptance = _numReviewsForAcceptance;
        newProposal.credsNeededForReview = _credsNeededForReview;
        newProposal.percentAcceptsNeeded = _percentAcceptsNeeded;
        newProposal.minCredsToProposeVote = _minCredsToProposeVote;
        newProposal.minCredsToVote = _minCredsToVote;
        newProposal.maxCredsCountedForVote = _maxCredsCountedForVote;
        newProposal.minProposalVotes = _minProposalVotes;
        newProposal.timestamp = block.timestamp;
        newProposal.isActive = true;

        // Approve and send link fee to our upkeep
        linkToken.approve(AutomationContractAddress, proposalFeeInLink);
        AutomationContract.addFunds(upkeepId, proposalFeeInLink);

        // Increment the proposalCounter
        proposalCounter++;

        emit ProposalCreated(msg.sender, _subjectName, _numReviewsForAcceptance, _credsNeededForReview, _percentAcceptsNeeded, _minCredsToProposeVote, _minCredsToVote, _maxCredsCountedForVote, _minProposalVotes, block.timestamp, true);
    }


    /*

        * @notice Allows a reviewer to vote on a proposal.
        * @dev Ensures the proposal exists and the voter meets the requirements.
        * @param proposalId ID of the proposal to vote on.
        * @param voteChoice Choice of the voter (true for approve, false for deny).
    */
    function vote(uint256 proposalId, bool voteChoice) external {
        // Ensure the proposal exists
        require(proposalId < proposalCounter, "Proposal does not exist.");

        // Ensure The Proposal is Active

        Proposal storage proposal = proposals[proposalId];
        require(proposal.isActive == true, "Proposal is no longer Active");

        // Ensure the voter is a reviewer for the subject
        string memory subjectName = proposal.subjectName;
        require(reviewersMap[msg.sender].subjectInfo[subjectName].isReviewer == true, "You are not a reviewer for this subject.");

        // Ensure the voter has not voted before
        require(!proposal.votes[msg.sender], "You have already voted.");

        // Ensure the voter has more creds than the minCredsToVote
        uint256 voterCreds = reviewersMap[msg.sender].subjectInfo[subjectName].creds;

        require(voterCreds >= subjects[proposal.subjectName].minCredsToVote, "Insufficient creds to vote.");

        // Determine the amount of creds to count for the vote
        uint256 credsToCount = (voterCreds > subjects[proposal.subjectName].maxCredsCountedForVote) ? subjects[proposal.subjectName].maxCredsCountedForVote : voterCreds;


        if (voteChoice) {
            // If vote is true, add to approvevotes and approvecreds
            proposal.approveVotes += 1;
            proposal.approveCreds += credsToCount;
        } else {
            // If vote is false, add to denyvotes and deny creds
            proposal.denyVotes += 1;
            proposal.denyCreds += credsToCount;

        }

        // Mark the voter as having voted
        proposal.votes[msg.sender] = true;        

        emit Voted(proposalId, msg.sender, voteChoice);
    }



    /*
        * @notice Checks if upkeep is needed for proposals.
        * @dev Determines if the current time exceeds the proposal's timestamp plus the open vote time.
        * @param check data (unused in this function but might be needed for interface compatibility).
        * @return upkeepNeeded Boolean indicating if upkeep is needed.
        * @return performData Data to be used in the performUpkeep function (unused here).
    */
    function checkUpKeep(bytes calldata /* check data*/)  external view  returns( bool upkeepNeeded, bytes memory /* performData*/  ){
        upkeepNeeded = (block.timestamp > proposals[proposalQueueCounter].timestamp + openVoteTime);
    }


    /*
   * @notice Performs the upkeep of proposals.
   * @dev Revalidates proposals based on the current time and proposal conditions.
   * @param performData Data from the checkUpKeep function (unused here).
    */

    function performUpkeep(bytes calldata /* performData */) external {

        // revalidation
        if (block.timestamp > proposals[proposalQueueCounter].timestamp + openVoteTime) {
            Proposal storage proposalToCheck = proposals[proposalQueueCounter];


            // Check if the proposal has more approve votes than deny votes and more approve creds than deny creds or both cred amounts are 0 (when maxCredsCountedForVote is set to 0)
            if ( (proposalToCheck.approveVotes > proposalToCheck.denyVotes) && (proposalToCheck.approveCreds > proposalToCheck.denyCreds || subjects[proposalToCheck.subjectName].maxCredsCountedForVote == 0 ) && (proposalToCheck.approveVotes + proposalToCheck.denyVotes >= subjects[proposalToCheck.subjectName].minProposalVotes) ){
                // Update the subject's variables with the proposal's values

                Subject storage subjectToUpdate = subjects[proposalToCheck.subjectName];

                subjectToUpdate.numReviewsForAcceptance = proposalToCheck.numReviewsForAcceptance;
                subjectToUpdate.credsNeededForReview = proposalToCheck.credsNeededForReview;
                subjectToUpdate.percentAcceptsNeeded = proposalToCheck.percentAcceptsNeeded;
                subjectToUpdate.minCredsToProposeVote = proposalToCheck.minCredsToProposeVote;
                subjectToUpdate.minCredsToVote = proposalToCheck.minCredsToVote;
                subjectToUpdate.maxCredsCountedForVote = proposalToCheck.maxCredsCountedForVote;
                subjectToUpdate.minProposalVotes = proposalToCheck.minProposalVotes;

                proposals[proposalQueueCounter].passed = true;

                emit ProposalResult(proposalQueueCounter, true);
                emit SubjectUpdated(proposalToCheck.subjectName, 
                proposalQueueCounter, 
                subjectToUpdate.creator,
                subjectToUpdate.numReviewsForAcceptance, 
                subjectToUpdate.credsNeededForReview, 
                subjectToUpdate.percentAcceptsNeeded, 
                subjectToUpdate.minCredsToProposeVote, 
                subjectToUpdate.minCredsToVote, 
                subjectToUpdate.maxCredsCountedForVote, 
                subjectToUpdate.minProposalVotes);
            }
            else{
                 proposals[proposalQueueCounter].passed = false;
                emit ProposalResult(proposalQueueCounter, false);

            }

            proposals[proposalQueueCounter].isActive = false;
            proposalQueueCounter++;


        }
    }







    // Only Owner Funcitons
    function setAutomationRegistry(address _contractAddress) external onlyOwner {
        AutomationContract= ChainlinkAutomation(_contractAddress);
        AutomationContractAddress= _contractAddress;

    }

    function setFee(uint256 _feePrice) external onlyOwner {
        proposalFeeInLink= _feePrice;

    }


    function setOpenVoteTime(uint256 _votetime) external onlyOwner {
        openVoteTime= _votetime;

    }

    function setUpkkepId(uint256 _upkeepId) external onlyOwner {
        upkeepId= _upkeepId;

    }
    function setProposalCounter(uint256 _count) external onlyOwner {
        proposalCounter= _count;

    }





    // Getters
    function getSubjectInfo(string memory _subjectName) external view returns (uint256 numReviewsForAcceptance,uint256 credsNeededForReview,uint256 percentAcceptsNeeded){
        require(subjects[_subjectName].creator!= address(0), "Subject Does Not Exsist");
        return(subjects[_subjectName].numReviewsForAcceptance, subjects[_subjectName].credsNeededForReview, subjects[_subjectName].percentAcceptsNeeded);
    }


    function getReviewerIsReviewer(address reviewerAddress, string memory subjectName) external view returns (bool) {
        return reviewersMap[reviewerAddress].subjectInfo[subjectName].isReviewer;
    }

    function getReviewerCreds(address reviewerAddress, string memory subjectName) external view returns (uint256) {
        require(reviewersMap[reviewerAddress].subjectInfo[subjectName].isReviewer == true, "Reviewer Does Not Exsist For this subject");
        return reviewersMap[reviewerAddress].subjectInfo[subjectName].creds;
    }

    function hasReviewerGivenCred(address reviewerAddress, string memory subjectName, address givenBy) external view returns (bool) {
        return reviewersMap[reviewerAddress].subjectInfo[subjectName].hasGivenCred[givenBy];
    }


    function getReviewerInfo(address reviewerAddress) external view returns (string memory, string memory, string[] memory, string[] memory) {
        return (reviewersMap[reviewerAddress].name, reviewersMap[reviewerAddress].description, reviewersMap[reviewerAddress].degrees, reviewersMap[reviewerAddress].awards);
    }

    function getProposalVote(address _address, uint256 _proposalId ) external view returns (uint256, uint256, uint256, uint256, bool ) {

        return (proposals[_proposalId].approveVotes, proposals[_proposalId].approveCreds, proposals[_proposalId].denyVotes, proposals[_proposalId].denyCreds, proposals[_proposalId].votes[_address]);
    }
    function getProposalResults( uint256 _proposalId ) external view returns (bool, bool ) {

        return ( proposals[_proposalId].isActive, proposals[_proposalId].passed);
    }




    /* 
        DEV FUNCTIONS
        DO NOT USE ANY OF THESE FUNCTIONS IN PRODUCTION
        MEANT TO ONLY BE USED FOR EASE OF TESTING

    */

    function setCreds(uint256 _creds, address _reviewer, string memory subjectName) external onlyOwner isDevMode{
       reviewersMap[_reviewer].subjectInfo[subjectName].creds = _creds;

    }
    function setProposalInactive(uint256 _proposalId) external onlyOwner isDevMode{
       proposals[_proposalId].isActive= false;

    }





}

